import React, { useEffect } from "react";
import { Helmet } from "react-helmet";

import NavBar from "../components/common/navBar";
import Footer from "../components/common/footer";
import Logo from "../components/common/logo";
import AllProjects from "../components/projects/allProjects";

import INFO from "../data/user";
import SEO from "../data/seo";

import "./styles/projects.css";

const Projects = () => {
	useEffect(() => {
		window.scrollTo(0, 0);
	}, []);

	const currentSEO = SEO.find((item) => item.page === "projects");

	return (
		<React.Fragment>
			<Helmet>
				<title>{`Projects | ${INFO.main.title}`}</title>
				<meta name="description" content={currentSEO.description} />
				<meta
					name="keywords"
					content={currentSEO.keywords.join(", ")}
				/>
			</Helmet>

			<div className="page-content">
				<NavBar active="projects" />
				<div className="content-wrapper">
					<div className="projects-logo-container">
						<div className="projects-logo">
							<Logo width={46} />
						</div>
					</div>
					<div className="projects-container">
						<div className="title projects-title">
							Things Iâ€™ve worked on during my career as a Scrum Master ,Project coordinator and Developer to help you get to know me better.
						</div>

						<div className="subtitle projects-subtitle">
							I've worked on a variety of projects, ranging from web and mobile applications to chatbots and AI solutions. Here are a few examples of my work.
							As a scrum master, I am responsible for facilitating the Scrum process, ensuring that the team adheres to Scrum theory, practices, and rules. I also help the team to remove any impediments that are preventing them from achieving their sprint goals. I work closely with the Product Owner to ensure that the product backlog is in good shape and ready for the next sprint.
						</div>

						<div className="projects-list">
							<AllProjects />
						</div>
					</div>
					<div className="page-footer">
						<Footer />
					</div>
				</div>
			</div>
		</React.Fragment>
	);
};

export default Projects;
